import styled from "styled-components";
import BottomNavBar from "../components/shared/BottomNavBar";
import { Container, ProcedureHeading, SubText } from "../Styles";

interface Props {}

export default function RequestPage(props: Props) {
  return (
    <Container>
      <Heading>이런 써클 만들어주세요!</Heading>
      <BottomNavBar selectedItem="feed" />
    </Container>
  );
}

const Heading = styled(ProcedureHeading)`
  padding-top: 50px;
  margin-left: 30px;
`;

const SubTextBookingBookingConfirm = styled(SubText)`
  margin-top: 40px;
  margin-left: 30px;
  width: 315px;
  margin-right: 30px;
  line-height: 1.2em;
  font-weight: 500;
  font-size: 11px;
  b {
    font-weight: 900;
  }
`;
